import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';

const Home = () => {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6 }
  };

  return (
    <div className="min-h-screen">
      <section className="relative h-screen bg-gradient-to-r from-green-600 to-green-800">
        <div className="container mx-auto px-4 h-full flex items-center">
          <motion.div 
            className="max-w-2xl text-white"
            initial={fadeIn.initial}
            animate={fadeIn.animate}
            transition={fadeIn.transition}
          >
            <h1 className="text-5xl font-bold mb-6">Revolutionizing Fresh Produce Packaging</h1>
            <p className="text-xl mb-8 text-gray-100">A research-driven sustainable solution to reduce post-harvest losses in papayas and promote eco-friendly alternatives.</p>
            <div className="space-x-4">
              <Link to="/research" className="inline-block px-6 py-3 bg-white text-green-700 font-semibold rounded-lg hover:bg-gray-100 transition-colors">
                View Research
              </Link>
              <Link to="/impact" className="inline-block px-6 py-3 border-2 border-white text-white font-semibold rounded-lg hover:bg-white/10 transition-colors">
                Our Impact
              </Link>
            </div>
          </motion.div>
        </div>
      </section>

      <section className="py-20 bg-white">
        <div className="container mx-auto px-4">
          <div className="text-center mb-16">
            <h2 className="text-3xl font-bold text-gray-800 mb-4">Key Features</h2>
            <p className="text-gray-600 text-lg">Discover how The Green Crate combines innovation with sustainability</p>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            <motion.div 
              className="bg-white p-8 rounded-xl shadow-lg hover:shadow-xl transition-shadow"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.2 }}
            >
              <div className="text-4xl mb-4">ðŸŒ±</div>
              <h3 className="text-xl font-semibold mb-4 text-gray-800">Biodegradable Material</h3>
              <p className="text-gray-600">Made from sustainable bamboo fibers, ensuring complete biodegradability while maintaining durability.</p>
            </motion.div>

            <motion.div 
              className="bg-white p-8 rounded-xl shadow-lg hover:shadow-xl transition-shadow"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.4 }}
            >
              <div className="text-4xl mb-4">ðŸ”¬</div>
              <h3 className="text-xl font-semibold mb-4 text-gray-800">Antimicrobial Coating</h3>
              <p className="text-gray-600">Innovative citric and lactic acid treatment prevents microbial growth and extends produce shelf life.</p>
            </motion.div>

            <motion.div 
              className="bg-white p-8 rounded-xl shadow-lg hover:shadow-xl transition-shadow"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.6 }}
            >
              <div className="text-4xl mb-4">ðŸ“Š</div>
              <h3 className="text-xl font-semibold mb-4 text-gray-800">Proven Results</h3>
              <p className="text-gray-600">20% reduction in weight loss and significant decrease in microbial activity during storage.</p>
            </motion.div>
          </div>
        </div>
      </section>

      <section className="py-20 bg-gray-50">
        <div className="container mx-auto px-4">
          <div className="max-w-4xl mx-auto">
            <motion.div 
              className="text-center"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
            >
              <h2 className="text-3xl font-bold text-gray-800 mb-6">Research-Backed Innovation</h2>
              <p className="text-gray-600 text-lg mb-8">Our solution is the result of extensive scientific research and testing, focusing on addressing real-world challenges in the fresh produce industry.</p>
              <Link to="/research" className="inline-block px-6 py-3 bg-green-600 text-white font-semibold rounded-lg hover:bg-green-700 transition-colors">
                Learn More
              </Link>
            </motion.div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
